import { useParams } from "react-router-dom";

import './styles.scss'
import useGetData from '../../../hooks/useGetData';

import BgNumber from '../BgNumber';
import FieldTitle from "../FieldTitle";

const UserDetailes = () => {
    let params = useParams();
    console.log(params.userId);

    const {data, error, loading} = useGetData(`https://jsonplaceholder.typicode.com/users/${params.userId}`);
    console.log(data)

    return (
         <main>
            <h2 key={data.id}>{data.name}</h2>
            <div 
            className='card' 
            style={{
                width: "70%", 
                margin: "20px auto",
                fontSize: '50px'
                }}>
                <BgNumber id = {data.id}/>

                <p><FieldTitle title="Username" />{data.username}</p> 
                <p><FieldTitle title="Email" />{data.email}</p>
                <p><FieldTitle title="Phone" />{data.phone}</p> 
                <p><FieldTitle title="Website" />{data.website}</p> 
                {/* <p><FieldTitle title="Company" />{data.}</p> 
                <p><FieldTitle title="Address" />{data.street}, {data.suite}, {data.city}, {zipcode}</p>  */} 
            </div>

    </main>
)}

export default UserDetailes;
